Anunciada a continuação da discussão da matéria, usam da palavra os Senadores Aloysio Nunes Ferreira, Lúcia Vânia e Ana Amélia.
      O Sr. Presidente Senador Renan Calheiros anuncia o recebimento do Ofício nº 6/2015/CONFAZ, de 07 de abril, subscrito pelo Coordenador dos Secretários no Conselho Nacional de Política Fazendária, solicitando o adiamento da apreciação da presente matéria. (Anexado ao processado)
      Usam da palavra, ainda, os Senadores José Serra, Marta Suplicy, Lindbergh Farias, Ronaldo Caiado, Antonio Carlos Valadares, José Agripino, Cássio Cunha Lima e Delcídio do Amaral.
      A seguir, é lido e aprovado o Requerimento nº 287, de 2015, tendo como primeiro signatário o Senador Romero Jucá, solicitando o reexame da matéria pela Comissão de Assuntos Econômicos.
      Estando a matéria em regime de urgência, é proferido pelo Senador Romero Jucá parecer de Plenário em Substituição à Comissão de Assuntos Econômicos, em reexame, concluindo favoravelmente à Emenda nº 1-CAE - Substitutivo, e às Emendas nºs 2 e 11-PLEN, nos termos do Substitutivo que apresenta - Emenda nº 16-PLEN. (Parecer nº 71, de 2015-PLEN)
      Em seguida, o Sr. Presidente Senador Renan Calheiros presta esclarecimentos acerca dos termos do parecer de plenário proferido em substituição à CAE, em reexame; procedendo à leitura das emendas acolhidas, de nºs 2 e 11-PLEN.
      Usam da palavra os Senadores José Serra, Aloysio Nunes Ferreira, Ricardo Ferraço, Eunício Oliveira, Vanessa Grazziotin, Romero Jucá e Waldemir Moka.
      São lidos os seguintes requerimentos:
      - Requerimento nº 288, de 2015, de autoria do Senador Ricardo Ferraço, solicitando destaque para votação em separado do § 6º do artigo 3º do PLS 130/2014 constante da Emenda nº 1-CAE;
      - Requerimento nº 289, de 2015, de autoria do Senador Ricardo Ferraço, solicitando destaque para votação em separado da Emenda nº 2-PLEN; 
      - Requerimento nº 290, de 2015, de autoria do Senador Ricardo Ferraço, solicitando destaque para votação em separado da Emenda nº 3-PLEN;
      - Requerimento nº 291, de 2015, de autoria do Senador Ricardo Ferraço, solicitando destaque para votação em separado da Emenda nº 4-PLEN;
      - Requerimento nº 292, de 2015, de autoria do Senador Romero Jucá, solicitando destaque para votação em separado da Emenda nº 5-PLEN;
      - Requerimento nº 293, de 2015, de autoria do Senador Romero Jucá, solicitando destaque para votação em separado da Emenda nº 6-PLEN;
      - Requerimento nº 294, de 2015, de autoria da Senadora Vanessa Grazziotin, solicitando destaque para votação em separado da Emenda nº 8-PLEN;
      - Requerimento nº 295, de 2015, de autoria da Senadora Marta Suplicy, solicitando destaque para votação em separado da Emenda nº 9-PLEN;
      - Requerimento nº 296, de 2015, de autoria do Senador Marta Suplicy, solicitando destaque para votação em separado da Emenda nº 10-PLEN;
      - Requerimento nº 297, de 2015, de autoria da Senadora Lúcia Vânia, solicitando destaque para votação em separado da Emenda nº 11-PLEN;
      - Requerimento nº 298, de 2015, de autoria do Senador José Serra, solicitando destaque para votação em separado da Emenda nº 13-PLEN;
      - Requerimento nº 299, de 2015, de autoria da Senadora Lúcia Vânia, solicitando destaque para votação em separado da Emenda nº 15-PLEN;
      O relator em Plenário, Senador Romero Jucá, apresenta manifestação contrária a todos os requerimentos de destaque para votação em separado.
      Usam da palavra os Senadores Ricardo Ferraço, Omar Aziz e Ronaldo Caiado.
      Rejeitados, em globo, os Requerimentos nºs 288 a 299, de 2015.
      É lido e aprovado o Requerimento nº 300, de 2015, de autoria do Senador Romero Jucá, solicitando preferência para votação da Emenda nº 16-PLEN (Substitutivo) antes da Emenda nº 1-CAE (Substitutivo).
      Aprovada a Emenda nº 16-PLEN (Substitutivo) com o seguinte resultado: Sim 63, Não 07, Abst. 01, Presidente 01, Total 72; tendo usado da palavra os Senadores Lídice da Mata, Eunício Oliveira, Cássio Cunha Lima, Walter Pinheiro, Ana Amélia, Luiz Henrique, Ronaldo Caiado, Otto Alencar, Baliro Maggi, Vanessa Garzziotin, Randolfe Rodrigues e Fernando Bezerra Coelho.
      Prejudicados o projeto e as demais emendas.
      Encaminhado à publicação o Parecer nº 72, de 2015-CDIR, relatora Senadora Angela Portela, apresentando a redação do vencido para o turno suplementar.
      Discussão encerrada do substitutivo, em turno suplementar, sem apresentação de emendas, senda a matéria adotada definitivamente, sem votação, nos termos do art. 284, RISF.
      À Câmara dos Deputados.

Aprovado o projeto.
