Anunciada a matéria, é lido e aprovado o Requerimento nº 462, de 2015, de autoria do Senador Romero Jucá, solicitando que sobre o projeto seja ouvida, também, a Comissão de Constituição, Justiça e Cidadania.
      A seguir, é proferido pela Senadora Ana Amélia, relatora designada em substituição às Comissões de Assuntos Socais; e de Constituição, Justiça e Cidadania, o Parecer nº 127, de 2015-PLEN, concluindo pela rejeição do SCD 5/2015 e pela manutenção do PLS 224/2013, com as seguintes ressalvas:
      - § 5º do art. 2º do SCD 5/2015, que deve ser aprovado, substituindo os §§ 4º e 5º do art. 2º do PLS 224/2013;
      - art. 34 do SCD 5/2015, que deve ser aprovado, substituindo o art. 47 do PLS 224/2013;
      - § 4º do art. 6º do SCD 5/2015, que deve ser aprovado, e inserido no art. 14 do PLS 224/2013 também como § 4º;
