      - art. 45 do PLS 224/2013, cuja supressão no SCD 5/2015 deve ser mantida, renumerando-se os demais dispositivos; e
      - § 4º do art. 11-A da Lei nº 10.593, de 6 de dezembro de 2002, constante do art. 44 do PLS 224/2013, cuja supressão no SCD 5/2015 deve ser mantida.
